import Tchc from "views/Tchc.js";
var routestchc = [
  {
    path: "/qlyc",
    name: "Quản Lý Yêu cầu",
    rtlName: "إخطارات",
    icon: "tim-icons icon-bell-55",
    component: Tchc,
    layout: "/tchc"
  },
];
export default routestchc;
